CREATE DEFINER=`jpingenieria_jpnet2023`@`%` PROCEDURE `AgregarTareadoComun` (IN `FECHA_IN` DATE, IN `HoraDeIngreso_IN` TIME, IN `HoraInicioAlmuerzo_IN` TIME, IN `HoraFinAlmuerzo_IN` TIME, IN `HoraSalida_IN` TIME, IN `idEmpleado_IN` INT, IN `EstacionDeTrabajo_IN` INT, IN `idCondicionTrabajo` INT)   BEGIN

