    DECLARE ID_TAREO INT;
    DECLARE cantPago float;
    DECLARE idPeriodo_IN INT;
    
	SET ID_Contrato = (SELECT idContrato FROM contrato  WHERE contrato.idEmpleado = idEmpleado_IN AND contrato.idCondicionDeContrato = 1);
    VALUES(ID_Contrato,FECHA_IN,HoraDeIngreso_IN,HoraInicioAlmuerzo_IN,HoraFinAlmuerzo_IN,HoraSalida_IN,EstacionDeTrabajo_IN, idCondicionTrabajo);
    
    IF TIME_TO_SEC(HoraDeIngreso_IN) = 0 AND TIME_TO_SEC(HoraSalida_IN) = 0 THEN
		
        SET ID_TAREO = (select idTareo FROM tareo order by idTareo desc LIMIT 1);
        SET idPeriodo_IN = (SELECT idPeriodo FROM periodo where FECHA_IN BETWEEN DiaDeInicioDelPeriodo AND DiaDeFinDelPeriodo);
		call CrearPagoDelTareo(ID_TAREO,0,idPeriodo_IN);
    
    ELSE
    
		SET ID_TAREO = (select idTareo FROM tareo order by idTareo desc LIMIT 1);
		SET cantPago = (Select SueldoBase/30 FROM datoscontables WHERE ID_Contrato = datoscontables.idContrato);
		SET idPeriodo_IN = (SELECT idPeriodo FROM periodo where FECHA_IN BETWEEN DiaDeInicioDelPeriodo AND DiaDeFinDelPeriodo);
		call CrearPagoDelTareo(ID_TAREO,cantPago,idPeriodo_IN);
        
    END IF;
END$$

