CREATE DEFINER=`jpingenieria_jpnet2023`@`%` PROCEDURE `ObtenerEmpleados` (`REG_INICIO` INT, `CANTIDAD_IN` INT)   BEGIN
SELECT * FROM jpingenieria_jpnet2023.empleado CN 
    INNER JOIN  jpingenieria_jpnet2023.persona PO ON CN.idPersona = PO.idPersona 
    INNER JOIN jpingenieria_jpnet2023.cargo CG ON CG.idCargo = CN.idCargo 
    INNER JOIN jpingenieria_jpnet2023.contrato CT ON CT.idEmpleado = CN.idEmpleado
    INNER JOIN estaciondetrabajo ET ON ET.idEstacionDeTrabajo = CT.idEstacionTrabajo
    WHERE CN.idEmpleado >= REG_INICIO AND CT.idCondicionDeContrato = 1 AND CT.empresa = 'AWL'
    LIMIT CANTIDAD_IN;
END$$

