    ON EMP.idPersona = PRS.idPersona WHERE PRS.DNI = DNI_IN); 
	SET IDContrato = (SELECT CT.idContrato FROM jpingenieria_jpnet2023.contrato CT 
    INNER JOIN jpingenieria_jpnet2023.empleado EMP ON CT.idEmpleado = EMP.idEmpleado 
    INNER JOIN persona PRS ON EMP.idPersona = PRS.idPersona WHERE PRS.DNI = DNI_IN AND CT.idCondicionDeContrato =1);
	SELECT COUNT(TR.idTareo) AS CantidadDeLicenciasConGoce  FROM tareo TR 
    WHERE TR.idCondicionDeTareo = 6 AND TR.idContrato = IDContrato and Fecha between FINICIO_IN and FECHAFIN_IN;
END$$

CREATE DEFINER=`jpingenieria_jpnet2023`@`%` PROCEDURE `ObtenerPlanilla` (IN `FINICIO_IN` DATE, IN `FECHAFIN_IN` DATE, IN `EMPRESA_IN` VARCHAR(3))   BEGIN
	Declare hoy date;
    
    SET hoy = (SELECT DATE_SUB(NOW(), INTERVAL 5 HOUR));
    
	SELECT CT.idContrato ,CT.FechaDeInicioDeContrato,CT.FechaDeFinDeContrato,CT.idEmpleado,PRS.Nombres,PRS.ApellidoPaterno,
    PRS.ApellidoMaterno,DCT.SueldoBase,PRS.DNI,DCT.NHijos,DCT.SueldoBase,DCT.idDatosContables,DCT.NHijos,FDP.idFondoDePension, 
    FDP.NombreEntidad,FDP.PorcentajeDeDescuento,CT.idEstacionTrabajo, CT.empresa,DCT.pensionAlimenticia
    FROM contrato CT 
    INNER JOIN empleado EMP ON CT.idEmpleado = EMP.idEmpleado 
    INNER JOIN datoscontables DCT ON CT.idContrato = DCT.idContrato 
    INNER JOIN fondodepension FDP ON EMP.idFondoDePension = FDP.idFondoDePension
    INNER JOIN persona PRS ON EMP.idPersona = PRS.idPersona  
    WHERE 
    
    -- CT.FechaDeInicioDeContrato <= FINICIO_IN AND FECHAFIN_IN <= CT.FechaDeFinDeContrato and
    CT.idCondicionDeContrato = 1 and CT.empresa = EMPRESA_IN;
    
END$$

CREATE DEFINER=`jpingenieria_jpnet2023`@`%` PROCEDURE `ObtenerTareos` (IN `DNI_IN` VARCHAR(10), IN `FINICIO_IN` DATE, IN `FECHAFIN_IN` DATE)   BEGIN
DECLARE IDEmpleado INT;
DECLARE IDContrato INT;
SET IDEmpleado = (
    SELECT EMP.idEmpleado
    FROM empleado EMP
      INNER JOIN persona PRS ON EMP.idPersona = PRS.idPersona
    WHERE PRS.DNI = DNI_IN
  );
SET IDContrato = (
    SELECT CT.idContrato
    FROM jpingenieria_jpnet2023.contrato CT
      INNER JOIN jpingenieria_jpnet2023.empleado EMP ON CT.idEmpleado = EMP.idEmpleado
      INNER JOIN persona PRS ON EMP.idPersona = PRS.idPersona
    WHERE PRS.DNI = DNI_IN
      AND CT.idCondicionDeContrato = 1
  );
SELECT *
FROM jpingenieria_jpnet2023.tareo TAR
 
WHERE TAR.Fecha between FINICIO_IN and FECHAFIN_IN
  AND TAR.idContrato = IDContrato
  ORDER BY TAR.Fecha ASC;
END$$

