CREATE DEFINER=`jpingenieria_jpnet2023`@`%` PROCEDURE `RegistrarDescansoMedico` (IN `Link_IN` TEXT, IN `idEmpleado_IN` INT, IN `Day_INICIO_IN` DATE, IN `Day_FIN_IN` DATE, IN `horaIngreso_IN` TIME, IN `horaSalida_IN` TIME, IN `horaAlmuerzo` TIME, IN `horaAlmuerzoFin` TIME)   BEGIN
