horaAlmuerzo,
horaAlmuerzoFin,
horaSalida_IN,
4,
idEstacionTrabajo_IN,
null,
null,
ID_DescansoMedico,
null,
null);
SET Day_INICIO_IN = DATE_ADD(Day_INICIO_IN, INTERVAL 1 DAY);
END WHILE;


