CREATE DEFINER=`jpingenieria_jpnet2023`@`%` PROCEDURE `RenovarContrato` (IN `idEmpleado_IN` INT, IN `fechaInicio` DATE, IN `fechaFin` DATE, IN `empresa_IN` VARCHAR(5), IN `motivoCese` INT, IN `cantHijos` INT, IN `sueldo` FLOAT)   BEGIN
	DECLARE idContrato_IN INT;
    DECLARE newContrato_IN INT;
    
    SET idContrato_IN = (SELECT idContrato FROM contrato WHERE idEmpleado=idEmpleado_IN AND idCondicionDeContrato=1);
    
    UPDATE `jpingenieria_jpnet2023`.`contrato`
	SET
	`idCondicionDeContrato` = 2,
	`idMotivoDeCese` = motivoCese
	WHERE `idContrato` = idContrato_IN;
    
	`idMotivoDeCese`,
	`idEmpleado`,
	`FechaDeInicioDeContrato`,
	`FechaDeFinDeContrato`,
	`empresa`)
	VALUES
	(1,
	null,
	idEmpleado_IN,
	fechaInicio,
	fechaFin,
	empresa_IN
	);
    
    SET newContrato_IN = (SELECT idContrato FROM contrato where idEmpleado =idEmpleado_IN and idCondicionDeContrato = 1);
    
`CISPP`,
`NHijos`,
`idContrato`)
VALUES
(sueldo,
null,
cantHijos,
newContrato_IN);

 
    
	UPDATE `jpingenieria_jpnet2023`.`tareo`
	SET
	idContrato = newContrato_IN
	WHERE `idContrato` = idContrato_IN;
    
END$$

CREATE DEFINER=`jpingenieria_jpnet2023`@`%` PROCEDURE `TotalTareadoHastaLaFecha` (IN `idContrato_IN` INT)   BEGIN
	SELECT ROUND(SUM(CantidadDePago),2)  FROM pagotareo 
	INNER JOIN periodo ON pagotareo.idPeriodo = periodo.idPeriodo 
	INNER JOIN tareo ON tareo.idTareo = pagotareo.idTareo
	WHere idContrato = idContrato_IN and curdate() between periodo.DiaDeInicioDelPeriodo and periodo.DiaDeFinDelPeriodo;
END$$

